  Data({
      int? curPage, 
      List<Datas>? datas,
      int? offset, 
      bool? over, 
      int? pageCount, 
      int? size, 
      int total = 0}){
    _curPage = curPage;

    if(datas!=null){
      this.datas = datas;
    }

    _offset = offset;
    _over = over;
    _pageCount = pageCount;
    _size = size;
    this.total = total;
}

  Data.fromJson(dynamic json) {
    _curPage = json["curPage"];
    if (json["datas"] != null) {
      this.datas = [];
      json["datas"].forEach((v) {
        this.datas.add(Datas.fromJson(v));
      });
    }
    _offset = json["offset"];
    _over = json["over"];
    _pageCount = json["pageCount"];
    _size = json["size"];
    this.total = json["total"];
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map["curPage"] = _curPage;
      map["datas"] = this.datas.map((v) => v.toJson()).toList();
    map["offset"] = _offset;
    map["over"] = _over;
    map["pageCount"] = _pageCount;
    map["size"] = _size;
    map["total"] = this.total;
    return map;
  }

}

